// osm-provider.js
const osm = {
    maptiler: {
        url: "https://api.maptiler.com/maps/topo-v2/256/{z}/{x}/{y}.png?key=6v9gZ7p3VMkhZOhUEyJd",
        attribution: "Map data © MapTiler, © OpenStreetMap contributors"
    }
};

export default osm;
